import React, { Component } from 'react';

// import allEars from "../../pictures/allears.png";
// import pause from "../../pictures/pause.png";
import shareScreen from "../../pictures/sharescreen.png";

class Page8 extends Component {

    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
  }
    render() {
        return (
            <div className="sheet">
                 <h1 id="p8title" className="bold center">Brainstorming additional coping strategies</h1>
                <div id="page8" className="left">
                    <div className='container_for_small_margin'>
                        <p>
                            During mentoring we talked about three main coping strategies. There are probably lots of activities that will help you manage your emotions.<br/><br/>
                            Let's look at the coping strategy card sort again. 
                        </p>
                    </div>

                    <div id="instruction_box_number_1_page_8_sheet_13" className="custom_svg demo_box container_for_medium_margin">
                        <p className="top_line_in_instruction_box other_text_in_instruction_box"> 
                            Share your screen  and send your mentee the card sort link
                         </p>
                    </div>
                        <img src={shareScreen} alt="Share screen" id="shareScreen_number_1_page_8_sheet_11" />
                </div>
            </div>
        )
    }
    
}

export default Page8;
